(85906, 177720, 0, 1, '逃脫社會（1017 Hito Studio 側錄版）', '', '2014-10-17 00:00:00', 2000, 19, 1, 7, '我在驚恐 時間停止轉動\n情緒失控 人性消泯沈默\n迎著逆風 惶恐疑慮出籠\n蠶食光明 殘剩灰暗天空\n\n現實生活 沒有什麼理由\n不該去做 什麼白日美夢\n想要解脫 幻想夢想人生\n逃避工作 離開社會牢籠\n\n討厭的社會迴圈  我不想跟著繞圈\n幻想著世界改變  期待着改變那天\n\n把我給拉離人間 將我心墮入欺騙\n我沒有太多時間 推我入塵封永眠\n\n心中有許多頓點 步調將停止不前\n翻開一切的遮掩 逃脫這悲哀社會', '', 233, '', '', '', '', '佐安薇', '', 0, 1, 0, '2014-10-19 10:12:24', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
(85907, 177720, 0, 1, 'Fucking Liar（1017 Hito Studio 側錄版）', '', '2014-10-17 00:00:00', 2000, 19, 1, 7, '等待的話語在我耳中 迴盪 \n銀色手機默默休眠著 靜躺 \n夜晚的等待卻是一陣 空蕩噢 令人難過的盼望\n\n遙遙無期我耗盡時間 迷惘\n層層謊言你不斷說著 失望\n無限的理由想要掩蓋 真相我要將你狠狠遠放\n\nYou’re a fucking liar , such a loser.\nDo not enter my world , get out of here.\nYou’re a betrayer, faking a dreamer.\nKicking you away will be better .\n\n不要再和我說盡謊言 欺騙著我的眼\n反反覆覆地使我厭倦 Just get out of my way\n\nYou’re a fucking liar , such a loser. \nDo not enter my world , get out of here. \nYou’re a betrayer, faking a dreamer. \nYou leave me away will be better .\n\nYou’re a fucking liar , such a loser. \nDo not enter my world , get out of here. \nYou’re a betrayer, faking a dreamer. \nYou leave me away will be better .\nJust leave me away, you fucking liar. ', '', 250, '', '佐安薇', 'JAPAN', '', '佐安薇', '', 0, 1, 0, '2014-10-19 10:17:50', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
(85908, 132803, 0, 1, '未知、奔跑、迷失。退後一步就能看清方向', '', '2013-10-19 00:00:00', 2000, 10, 0, 7, '拼命的在這趟"未知"的人生旅程中"奔跑"著，卻又總是在不經意的時刻中"迷失"了自我。只要認真的"退後一步，就能看清前進的方向"。\n', '', 325, '', '', '', '', 'Beware the Sky Falling', '', 0, 1, 0, '2014-10-19 15:35:24', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
