(85915, 317179, 7626, 1, 'Wilderness for Freedom｜自由野', '為了追尋夢想．必先擁抱自由\n由第33屆香港電影金像獎．最佳原創電影歌曲《狂舞吧》原班底：戴偉、陳心遙、阿佛傾力製作，\n黃宇希首支個人單曲《Wilderness for Freedom｜自由野》。', '2014-05-27 00:00:00', 2000, 23, 0, 2, 'Rap:\nBefore you Judge me from head to toe,\nCome walk in my shoes, so then you''ll know\nIt wasn''t easy to be me\nLike every door has a zip code\n(oh ooh)\nGotta find my way to the top\nand the time''s running out tick tock\n(don''t stop, don''t drop)\nand I know "that" I made mistake\nWith no regrets because\nLife is a tragedy\nbut I hold on to gravity\nI was worse than depravity\nBut I found my ability\nTake note, I was a little girl dreaming to be a star\nNothing can stop me from getting there not even the world war!\n\n放棄過去那地圖\n厭了再走公式化的旅途\n太理智　才不好\n有個曠野叫自由\n你我每天　可擁抱\n在秘密的領土\n\n誰狂熱如火\n未畏高　未會躲　是我的錯\n共你一對　跳著　瑰麗探戈\n讓你選　在禁宮　清醒的過\n還是被放逐野外　著了魔\n\nRap:\nHave you ever really been in love?\nGave him everything he wants but he thinks you ain''t enough for him but you don''t give in ..\nD o anything for the love ..\nFelt like you were cursed cause the words won''t stop it going on reverse first thing you gotta\nknow ..\nLife ain''t a TV show ..\nY.o.l.o yes Baby gotta play your best role\nLive with no boundaries yes that''s my motto cause the freedom never was out there ... it is\ninside of me...\n\n聽說世界太糊塗\n變革要等忠於愛的信徒\n這信仰　藏不到\n暗角那片向日葵\n永遠背光　怎知道\n被照耀的美好\n\n誰狂熱如火\n未畏高　未會躲　是我的錯\n共你一對跳著　瑰麗探戈\n讓你選　在禁宮　清醒的過\n還是被放逐野外　著了魔\n未畏高　　是我的錯\n跳著　瑰麗探戈\n還是被放逐野外　著了魔\n\n誰狂熱如火\n未夠瘋　就更瘋　最好不過\n就趁知覺敏銳　試盡禁果\n讓你選　在課室　規矩的坐\n還是在制度以外　做野火', '', 283, '', '戴偉', '陳心遙、黃宇希', '戴偉、阿佛', '框格音樂Honger Music', '', 0, 1, 0, '2014-10-20 10:33:54', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
(85916, 317216, 7627, 1, '木吉他', '用木吉他為名，唱出這些年的感觸與心情。\n想到袁惟仁，總是和木吉他分不開，民謠吉他的清新音樂風格，一直是小胖老師的標準配備，但沒想到在大家都習以為常的木吉他歌曲中，他竟藉著雷鬼節奏，賦予大家熟悉的袁惟仁音樂風格，另外的生命力。\n歌曲由1985年第一次在民歌西餐廳登台演唱拉開序幕，整個華語樂壇叱吒風雲的人物，當年幾乎都在同樣的環境中養成，袁惟仁用這樣的場景，描述一個夢想的發源，也成為這張專輯的起源。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 242, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-20 14:56:51', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
(85917, 317216, 7627, 2, '東區那條巷子', '城市裡的故事，永遠說不完，在袁惟仁細膩的創作裡，有多少心事是屬於每個遊走在這座城市裡孤獨的心靈。\n台北市東區，或者說每個城市的東區，都有著不可取代的象徵性，我們慣用東區來稱呼這個城市最豐富多彩的一隅，在那樣的角落，悄悄上演著每個人都經歷過的故事。\n袁惟仁用一把簡單的吉他，將一段愛情裡等待回味期盼的種種情緒表達無遺。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 220, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-20 14:58:16', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
(85918, 317216, 7627, 3, '聽說妳在上海', '漂，是一種狀態也是一種身分。\n移居到某座城市是因為不得不然，在現代都市中，有來自各個不同地方的漂人。\n聽說你在上海，是一首為存活在這時代裡，認真生活努力找尋自己夢想的人所寫的歌。\n在異鄉打拼，游移不定的身分和心情，談了幾段戀愛卻對未來有著遲疑。\n藉著吉他和簡單的打擊節奏，袁惟仁再次用他充滿溫暖磁性的嗓音和創作，為這時代記錄下深刻又感人的心聲。\n『曾經那麼愛，如今那麼遠。世界上唯一不變的，叫做善變。』，講述了人與距離的關係，也講述了人與人的心情。\n袁惟仁擅長挖掘人們的心事，在看似每個人都會經歷的簡單故事中，輕描淡寫幾筆就將內心最深處的感觸和感動同時翻掘浮出。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 272, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-20 15:00:50', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
