(85921, 719, 7197, 2, '一路向東 (Feat. Suming 舒米恩)', '黃玠在大自然三部曲中，分別與女孩與機器人合作時尚電子舞曲，與黃小楨共創民謠新經典，第三部與Suming的合作中則實現了饒舌創作的夢想。\n「一路向東」重複出現的是“我從台北搭夜車到台東，這很困難對我來說”，對黃玠來說真正困難的其實是拋開現實的一切，單純去旅行，而Suming則反覆地對他唱著：「你看你的右邊那是山，你看你的左邊那是海。」跟著拼貼的鼓點節奏，跟著黃玠的饒舌，我們一路從台北搭夜車到台東。\n這一路，你看見了什麼風景呢？是不是也跟黃玠一樣找回了一些自己呢？\n', '2014-11-03 00:00:00', 2000, 19, 0, 5, '我從台北搭夜車到台東  這很困難對我來說\n我從台北搭夜車到台東  我的行李沒有太重\n\n這個晚上  搭了一班最慢的火車  感覺自己是活的\n慢慢離開這個城市  寂寞的人住在哪裡都只是過客\n這趟旅行與其說是渡假\n不如說是逃離不明的害怕\n生活在心裡蓋了座無形的墻\n堅固而且巨大\n車廂的燈隨著歲月漸漸變成了藍色\n柔軟的光線讓它摧毀我的思考   \n鐵軌的聲音像是告訴我為何要來這\n規律的講解讓它催眠我的大腦         \n \n於是 那畫面不斷的fade in  \n海的味道不斷的接近\n窗外的漆黑讓我不斷的飛進     \n飛進不斷的回憶\n\n那狀態自由的像風\n那狀態自在地像夢\n那狀態自由的像風 \n帶著我一路向東  \n\n下了火車慢慢的走我不趕時間\n租了台車我騎向海邊\n用最悠閒的速度前往台１１線\n現在精神正好  晚上１１點\n沿途散發自然的香 聞著香味我自然的ㄎㄧㄤ\n而我自然地將車燈都關上\n而我自然的想看一看天上\n看一看天上這樣的清澈星星滿佈\n驅散了心裡的愁雲慘霧\n星空像詩人用優雅的談吐\n告訴我不需要趕路\n來到東部把自己放生\n丟掉包袱的     我是合格的浪人\n海的聲音越來越大聲\n就讓我來這裡 快樂的唱歌\n', '', 258, '', '黃玠', '黃玠', '', '風和日麗', '', 1, 1, 0, '2014-10-20 15:20:13', '2015-03-12 14:13:04', '0000-00-00 00:00:00'),
