(85927, 317403, 7628, 1, '謝謝老師', '', '2014-10-22 00:00:00', 2014, 19, 0, 4, '『謝謝老師』是為了幫助台灣偏鄉的貧童就學，由豐華唱片與TVBS關懷台灣文教基金會共同發行的公益募款單曲。\n\n台灣大約240萬個國中、小學生當中，就有將近20%的學生，屬於隔代教養、單親、外配家庭等經濟弱勢的族群，如何協助這些偏鄉孩子培養競爭力，未來不再只能打零工、當黑手，陷入貧窮的循環?\n\n「熱情」而且「會教」的老師是孩子「脫貧」的關鍵，藉由熱情老師的引導下多元學習，讓學業成績不再是唯一選項，激發孩子的創意及想像力，找到適當的志向、持續學習、培養一技之長，讓每個孩子都能找到屬於自己的亮點，有機會發展無限可能的未來。要改變台灣，我們需要老師！要翻轉孩子的未來，我們要依靠老師！\n\n在TVBS關懷台灣文教基金會終身志工李濤搖旗吶喊之下，張小燕無償為基金會製作一首新歌『謝謝老師』鼓舞老師士氣，期待更多熱情老師加入幫助偏鄉孩子脫貧的行列。\n\n『謝謝老師』由李濤、黃子佼作詞，藉著黃子佼、左左右右歡樂可愛的歌聲，\n散播我們對老師的感謝，給老師一個讚的鼓勵。\n\n請跟我們一起分享這首好聽又別具意義的歌曲，我們會將收入扣除成本之後，全數捐給TVBS關懷台灣文教基金會幫助偏鄉貧童就學，您的愛心支持可以讓孩子們安心繼續學習，有機會脫離貧窮、翻轉未來。\n\n\n\n\n', '', 154, '', '', '', '', '豐華唱片 Forward Music', '', 0, 1, 0, '2014-10-21 13:51:50', '2015-03-12 14:13:05', '0000-00-00 00:00:00'),
